import React from 'react';
import AccessAlarmIcon from '@material-ui/icons/AccessAlarm';

const data = {
  menus: [
    { text: 'DashBoard', icon: <AccessAlarmIcon/>, link: '/dashboard' },
    { text: 'Pending', icon: <AccessAlarmIcon/>, link: '/form' },
  ],

};

export default data;
